import logo from './logo.svg';
import { AppDiv, AppHeader, AppLogo} from './App.styled';

function App() {
  return (
    <AppDiv>
      <AppHeader>
        <AppLogo src={logo} alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </AppHeader>
    </AppDiv>
  );
}

export default App;
